import Vue from "vue";
import App from "./App.vue";
import router from "./router";
import store from "./store";

global.jQuery = require("jquery");
var $ = global.jQuery;
window.$ = $;

Vue.config.productionTip = false;

// Vue.use(router);

new Vue({
  router,
  store,
  render: h => h(App)
}).$mount("#app");
